let deployChannel = async function(account, callback){
	// get web3
	let web3
	// Modern DApp Browsers
	if (window.ethereum) {
		web3 = new Web3(window.ethereum);
		try { 
		window.ethereum.enable().then(function() {
			// User has allowed account access to DApp...
		});
		} catch(e) {
		// User has denied account access to DApp...
		}
	}
	// Legacy DApp Browsers
	else if (window.web3) {
		web3 = new Web3(web3.currentProvider);
	}
	// Non-DApp Browsers
	else {
		alert('You have to install MetaMask !');
	}
	// not problem here
	const MyContract = new web3.eth.Contract(channel_abi)
	console.log('account', account)

	MyContract.deploy({
		data: '0x'+channel_bytecode.object,
		arguments:['0x2cdcC5d17c311e9eB853b0B0f4C51C4bcc8C246B', duration]
	}).estimateGas(function(error, gasAmount){
		// console.log(gasAmount)
		MyContract.deploy({
		data: channel_bytecode.object,
			arguments:['0x2cdcC5d17c311e9eB853b0B0f4C51C4bcc8C246B', duration]
		}).send({
			from: account,
			gasAmount: gasAmount * 2,
		})
		.on('error', (error) => {
			// console.log(error)
			callback(false)
		})
		.on('receipt', (receipt) => {
			// receipt will contain deployed contract address
			callback(receipt.contractAddress)
		})
	})
}

export default deployChannel